import { Link } from 'react-router-dom';

const dummyEvents = [
  {
    id: 'e1',
    title: 'Event 1',
  },
  {
    id: 'e2',
    title: 'Event 2',
  },
  {
    id: 'e3',
    title: 'Event 3',
  },
  {
    id: 'e4',
    title: 'Event 4',
  },
];

function EventsPage() {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {dummyEvents.map((element) => (
          <li key={element.id}>
            <Link to={element.id}>{element.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}

export default EventsPage;
